import React from "react";
import "./App.css";
import MainNavber from "./navbar";
import HelloApp from "./HelloApp";
import { Button, Card } from "react-bootstrap";

const numbers = [1, 2, 3, 4, 5];
const listItems = numbers.map((number) =>
  <button>{number}</button>
);

function App() {
  return (
    <div className="App">
      <MainNavber />
      <HelloApp />
      <Card/>
    </div>
  );
}

export default App;
